INSERT INTO public.movie_warnings (
  imdb_id, dtdd_topic_id, source, answer, is_spoiler, warning_comment
) VALUES (
  'tt0499549', 339, 'DTDD', 'yes', FALSE, 'MODERATE: When Jake touches some spiral-shaped plants, they contract with a loud *FOOP* sound. The first time it happens is pretty shocking.

MINOR: High up in a tree, Neytiri (with Jake) calls for her ikran/banshee companion. After a short silence, her ikran lunges out of the tree and roars. Not too jarring though.

MINOR: Whenever someone in closeup shoots off an arrow, the snap-back is loud and will likely make you flinch.

This movie is pretty chill, but the sequels have some really jump-worthy moments; check out the pages for those movies to see my notes.'
)
